import React from 'react';

const ContentVisuals = (props) => {
    return(
        <div className="content__visuals">
            <div className="imagebox">
                <img className=""
                    alt="Google Maps location" 
                    src="https://lh3.googleusercontent.com/proxy/vYTx_Qk4ZNzhO-8JoFFzHHHzliKGwkJgl723S_XP5IH55E4T2SCwirI_N89YT4ZlDfqQAYR2WtQ4bOjlp5OxcRiXKns0Lqd6prwxxyYyIwsFixBMMzIKzLE"
                    width="100%"
                    height="auto"
                >
                </img>
            </div>


            <div >
            <iframe
                width="100%"
                height="auto"
                frameborder="0" style="border:0"
                src="https://www.google.com/maps/embed/v1/place?key=AIzaSyDR3PxzNppBMCk7UYJRtSw4s2lRuLXku5M
                    &q=Space+Needle,Seattle+WA" allowfullscreen>
                </iframe>



            </div>
        </div>

    );
};

export default ContentVisuals;
